import React from 'react';
import { Link } from 'react-router-dom';
import './Work.css';

function Work() {
  const projects = [
    {
      title: 'Nova Brand',
      description: 'Brand identity',
      image: '/path/to/nova-image.jpg',
      link: '/work/NovaBrand'
    },
    {
      title: 'New Hel.fi',
      description: 'UX/UI Design',
      image: '/path/to/helfi-image.jpg',
      link: '/work/Hel_fi'
    },
    {
      title: 'Fira Brand & Website',
      description: 'Brand identity, UX/UI Design',
      image: '/path/to/fira-image.jpg',
      link: '/work/FiraBrand'
    }
  ];

  return (
    <div className="work-page">
      <h1>Work</h1>
      <div className="project-grid">
        {projects.map((project, index) => (
          <Link to={project.link} key={index} className="project-card">
            <img src={project.image} alt={project.title} />
            <h2>{project.title}</h2>
            <p>{project.description}</p>
          </Link>
        ))}
      </div>
    </div>
  );
}

export default Work;
